// this line should not be removed
var wCnn = angular.module("wCnn",[]);

wCnn.controller( "wCnnController", function( $scope ) {
	var dq = new DataQuery( 'qCnnRss' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.results = dq.getData();
			console.log($scope.results);
		});
	});

});
wCnn.filter('realImage', function() {
  return function(input) {
      if (!input) return '';
    return input.replace('-top-tease','');
  };
});
